import React, { Component, Fragment } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import NotFoundPage from './pages/NotFoundPage';
import HelloPage from './pages/HelloPage';
import ExitPage from './pages/ExitPage';
import HelpPage from './pages/HelpPage';
import AppointmentPage from './pages/AppointmentPage';
import DepartmentPage from './pages/DepartmentPage';
import DoctorPage from './pages/DoctorPage';
import SchedulePage from './pages/SchedulePage';
import AuthorizationPage from './pages/AuthorizationPage';

import Header from './components/Header/Header';

import styles from './App.module.css';

import Spinner from 'react-bootstrap/Spinner';
import Alert from 'react-bootstrap/Alert';



localStorage.clear()


function formatBirthDate(date) {
	const [day, month, year] = date.split('/');
	return `${year}-${month}-${day}`
}


const PROXY_URL = "https://proxy-q-doctor.herokuapp.com/api/emias/"
const SCHEDULE_URL = "schedule"


class App extends React.Component {
  constructor(props) {
    super(props);
		this.state = {loading: {flg: false}, err: ''};
	}

	fetchSchedule(omsNumber, birthDate) {
    console.log('test', omsNumber, birthDate)
    return fetch(PROXY_URL+SCHEDULE_URL+`?oms_number=${omsNumber}&birth_date=${birthDate}`,
                 {headers: {'Content-Type': 'application/json'}})
            .then(response => {
              if (response.status !== 200) {
                throw 'Server error'
              }
              return response
            })
            .then(response => response.json())
            .then(response => {
                    localStorage.setItem('schedule', JSON.stringify(response));
                    localStorage.setItem('authFlag', Boolean(Object.entries(response).length));
            })
            .then(_ => this.setState({...this.state, loading: {flg: false}}))
            .catch(err => this.setState({...this.state, loading: {flg: false}, err}))

  };

  handleAuthorization = person => {
    localStorage.setItem('birthDate', formatBirthDate(person.birthDate));
		localStorage.setItem('omsNumber', person.omsNumber);
		this.setState({...this.state, loading: {flg: true}});
    this.fetchSchedule(localStorage.getItem('omsNumber'), localStorage.getItem('birthDate'));
    console.log('test2');
  };

  render() {
    console.log(localStorage);
    const page = (
      <div className={styles.main}>
        <Switch>
          {/* <Route exact path="/" component={HelloPage} /> */}
          <Route path="/authorization">
            <AuthorizationPage handleSubmit={this.handleAuthorization} />
          </Route>
          {localStorage.getItem('authFlag') && <Route path="/appointment/department/:departmentId/doctor/:doctorId/schedule" component={SchedulePage} />}
          {localStorage.getItem('authFlag') &&<Route path="/appointment/department/:departmentId/doctor" component={DoctorPage} /> }
          {localStorage.getItem('authFlag') &&<Route path="/appointment/department" component={DepartmentPage} /> }
          {localStorage.getItem('authFlag') &&<Route path="/appointments" component={AppointmentPage} /> }
          <Route path="/help" component={HelpPage} />
          {localStorage.getItem('authFlag') && <Route path="/exit" component={ExitPage} /> }
          <Route exact path="/">
            <AuthorizationPage handleSubmit={this.handleAuthorization} />
          </Route>
          <Route path="/" component={NotFoundPage} />
        </Switch>
      </div>
    );

    const loadPage = (
      <div className={styles.loadPage} ><Spinner animation="border" variant="primary" /></div>
    );

    const errorPage = (
      <Alert variant="danger" onClose={() => this.setState({...this.state, err: ''})} dismissible>
        <Alert.Heading>Oh snap! You got an error!</Alert.Heading>
        <p>
          Change this and that and try again. Duis mollis, est non commodo
          luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit.
          Cras mattis consectetur purus sit amet fermentum.
      </p>
    </Alert>
    )

    // const successPage = ();

    return (
      <Router>
        <div className={styles.App}>
          <Header handleSubmit={this.handleAuthorization} active={Boolean(localStorage.getItem('schedule'))}/>
          {this.state.err ? errorPage : (this.state.loading.flg ? loadPage : page)}
        </div>
      </Router>
    );
  };
};

export default App;
